/**
 * @param {number} low
 * @param {number} high
 * @param {number} k
 * @return {number}
 */
var numberOfBeautifulIntegers = function(low, high, k) {
    let count = 0;
    for (let num = low; num <= high; num++) {
        if (num % k === 0 && isBeautiful(num)) {
            count++;
        }
    }
    return count;

    function isBeautiful(number) {
        let evenCount = 0, oddCount = 0;
        while (number > 0) {
            let digit = number % 10;
            if (digit % 2 === 0) evenCount++;
            else oddCount++;
            number = Math.floor(number / 10);
        }
        return evenCount === oddCount;
    }
};
